import { BrowserRouter, Route, Routes } from "react-router-dom";
import React from "react";
import Inicio from "./pages/Inicio";
export default function AppRouter() {
    return(
        <BrowserRouter>
            <Routes>
                <Route path="/" element={Inicio}></Route>
            </Routes>
        </BrowserRouter>
    )
}
